import './App.css';
import { createBrowserRouter,Outlet, RouterProvider, ScrollRestoration } from 'react-router-dom';

function App() {
  const router = createBrowserRouter([
    {
      path: "/",
      element: <Root />,
      loader: rootLoader,
      children: [
        {
          path: "team",
          element: <Team />,
          loader: teamLoader,
        },
      ],
    },
  ]);

  return (
    <div className="App">
           <RouterProvider router={router}/>
    </div>
  );
}

export default App;
